import { Row, Col } from "react-bootstrap";
import Company from "../components/Company";
import Links from "../components/Links";
import Contact from "../components/Contact";

function Footer() {
  const currentYear = new Date().getFullYear();

  return (
      <div className="background-dark text-white">
        <img width="100%" height={60} src="https://taxitema.tokotema.com/wp-content/uploads/2023/12/Shape-BG-1.png" />
          <footer className="container py-5 my-5">
            <Row className="justify-content-between">
              <Col lg="3">
                <Company/>
              </Col>
              <Col lg="3">
                <Links/>
              </Col>
              <Col lg="3">
                <Contact/>
              </Col>
            </Row>
            
          </footer>
          <div  style={{background:"#1C1C1C"}} className="background-dark text-center py-4">
          © {currentYear} Chauffeurs pro paris | Tous droits réservés
          </div>
      </div>
  );
}

export default Footer;
